import { booleanType, someType, functionType, stringType, anyType, objectType } from '../_util/type';
export var progressStatuses = ['normal', 'exception', 'active', 'success'];
var ProgressType = ['line', 'circle', 'dashboard'];
var ProgressSize = ['default', 'small'];
export var progressProps = function progressProps() {
  return {
    prefixCls: String,
    type: stringType(),
    percent: Number,
    format: functionType(),
    status: stringType(),
    showInfo: booleanType(),
    strokeWidth: Number,
    strokeLinecap: stringType(),
    strokeColor: anyType(),
    trailColor: String,
    /** @deprecated Use `size` instead */
    width: Number,
    success: objectType(),
    gapDegree: Number,
    gapPosition: stringType(),
    size: someType([String, Number, Array]),
    steps: Number,
    /** @deprecated Use `success` instead */
    successPercent: Number,
    title: String,
    progressStatus: stringType()
  };
};
